for (i = 1; i < perkList.length; i++)
{
	for (
		document.write(
			'<div class= "ListPerkContainer"><img class="ListPerkIcon" src="./assets/icons/perks/' +
			cellType[i] +
			'.png"><h4>' +
			cellType[i] +
			"</h4>"
		),
		j = 0; j < perkList[i].length; j++
	)
		document.write(
			'<div class="PerkButton  waves-effect waves-dark btn tooltipped plus6" data-position="right" data-tooltip="' +
			perkList[i][j].description +
			'" id="' +
			i +
			"_" +
			j +
			"\"" +
			" data-map=\"" +
			perkList[i][j].map +
			"\">" +
			perkList[i][j].name +
			"</div>"
		);
	document.write("</div>");
}
